window.bookSummaryJSON = "<p>Thousands of amateur radio operators have used the No-Nonsense study guides to get into amateur radio. You can, too. You will learn everything you need to know to get your Technician Class amateur radio license.</p> <p>In a simple, easy-to-understand style, this study guide will get you on the air in no time. This study guide includes every single question in the 2018 to 2022 question pool. Related questions are grouped together, and text has been added to add some context and tie it all together.</p> <p>This is what makes the No-Nonsense study guides easy to understand.</p>"; 
